// ==/UserScript==
// @name                  FireGestures.uc.js
// @description        滑鼠手勢
// @include               main
// @compatibility     Firefox 4.0+
// @author                紫雲飛
// @charset               UTF-8
// @homepage         
// @version              
// @updateURL         
// @update
// @note                   
// @include              chrome://browser/content/browser.xul
// ==/UserScript==
location == "chrome://browser/content/browser.xul" && (function () {
	ucjsMouseGestures = {
		lastX: 0,
		lastY: 0,
		directionChain: "",
		isMouseDownL: false,
		isMouseDownR: false,
		hideFireContext: false,
		shouldFireContext: false,
		GESTURES: {
			//開啟選取範圍內的所有鏈結(上)
			"U": {
				name: "\u9801\u9996/\u958B\u555F\u9078\u53D6\u7BC4\u570D\u5167\u7684\u6240\u6709\u93C8\u7D50",
				cmd: function() {
					if(getBrowserSelection()) {
					Array.filter(content.document.links, function(link) {
					arguments.callee.uniq = arguments.callee.uniq || [];
					if (!~arguments.callee.uniq.indexOf(link.toString()) && content.getSelection().containsNode(link, 1)) {
					arguments.callee.uniq.push(link.toString());
					return 1;
					}
					}).forEach(function(link) {
					gBrowser.addTab(link.toString())  && content.document.getSelection().removeAllRanges();
					});} else {
					content.scrollTo(0, 0);
 					}
				}
			},
			//頁尾(下)
			"D": {
				name: "\u9801\u5C3E",
				cmd: function() {
					goDoCommand("cmd_scrollBottom");
				}
			},
			//上一頁(左)
			"L": {
				name: "\u4E0A\u4E00\u9801",
				cmd: function() {
					getWebNavigation().canGoBack && getWebNavigation().goBack();
				}
			},
			//下一頁(右)
			"R": {
				name: "\u4E0B\u4E00\u9801",
				cmd: function() {
				var nav = gBrowser.webNavigation;
				if (nav.canGoForward){
  				    nav.goForward();
  				    }else{
  				      var document = content.document;
  				      var event = document.createEvent('HTMLEvents');
  				      event.initEvent('superPreloader.go', true, false);
  				      document.dispatchEvent(event);
  				    }
				}
			},
			//全螢幕(上右)
			"UR": {
				name: "\u5168\u87A2\u5E55(",
				cmd: function() {
					BrowserFullScreen();
				}
			},
			//選擇第一個分頁(上左)
			"UL": {
				name: "\u9078\u64C7\u7B2C\u4E00\u500B\u5206\u9801",
				cmd: function() {
					gBrowser.selectedTab = (gBrowser.visibleTabs || gBrowser.mTabs)[0];
				}
			},
			//關閉左側分頁(下左)
			"DL": {
				name: "\u95DC\u9589\u5DE6\u5074\u5206\u9801",
				cmd: function() {
					var tabs = gBrowser.mTabContainer.childNodes;
					for (var i = tabs.length - 1; tabs[i] != gBrowser.mCurrentTab; i--){}
					for (i--; i >=0 ; i--){
					gBrowser.removeTab(tabs[i]);
					};
				}
			},
			//關閉右側分頁(下右)
			"DR": {
				name: "\u95DC\u9589\u53F3\u5074\u5206\u9801",
				cmd: function() {
					var tabs = gBrowser.mTabContainer.childNodes;
					for (var i = tabs.length - 1; tabs[i] != gBrowser.selectedTab; i--)
					{
					gBrowser.removeTab(tabs[i]);
					};
				}
			},
			//關閉其他分頁(下上)
			"DU": {
				name: "\u95DC\u9589\u5176\u4ED6\u5206\u9801",
				cmd: function() {
					gBrowser.removeAllTabsBut(gBrowser.mCurrentTab);
				}
			},
			//重新載入分頁 跳過暫存(左右)
			"LR": {
				name: "\u91CD\u65B0\u8F09\u5165\u5206\u9801 \u8DF3\u904E\u66AB\u5B58",
				cmd: function() {
					BrowserReloadSkipCache();
				}
			},
			//重新載入所有分頁(右左)
			"RL": {
				name: "\u91CD\u65B0\u8F09\u5165\u6240\u6709\u5206\u9801",
				cmd: function() {
					gBrowser.reloadAllTabs();
				}
			},
			//翻譯(左下)
			"LD": {
				name: "\u7FFB\u8B6F",
				cmd: function() {
					var t = content.getSelection().toString();
					if(t) {gBrowser.selectedTab = gBrowser.addTab("http://translate.google.tw/translate_t?hl=zh-TW#auto|zh-TW|"+t);}
					else {loadURI("http://translate.google.com/translate?sl=auto&tl=zh-TW&u="+content.location);} 
				}
			},
			//簡轉繁(右下)
			"RD": {
				name: "\u7C21\u8F49\u7E41",
				cmd: function() {
					content.document.documentElement.appendChild(content.document.createElement("script")).src = "data:application/javascript;base64,";
				}
			},
			//繁轉簡(右下右)
			"RDR": {
				name: "\u7E41\u8F49\u7C21",
				cmd: function() {
					content.document.documentElement.appendChild(content.document.createElement("script")).src = "data:application/x-javascript;base64,";
				}
			},//全選並複製(上右下)
			"URD": {
				name: "\u5168\u9078\u4E26\u8907\u88FD",
				cmd: function() {
					goDoCommand('cmd_selectAll');
					setTimeout('goDoCommand("cmd_copy");',100);
					setTimeout('content.document.getSelection().removeAllRanges();',100);
				}
			},//關閉分頁(按住右鍵點擊左鍵)
			"L<R": {
				name: "\u95DC\u9589\u5206\u9801",
				cmd: function() {
					gBrowser.removeCurrentTab();
				}
			},
			//恢復關閉的分頁(按住左鍵點擊右鍵)
			"L>R": {
				name: "\u6062\u5FA9\u95DC\u9589\u7684\u5206\u9801",
				cmd: function() {
					undoCloseTab();
				}
			},
			//上一個分頁(按住右鍵滾輪向上)
			"W-": {
				name: "\u4E0A\u4E00\u500B\u5206\u9801",
				cmd: function() {
					gBrowser.tabContainer.advanceSelectedTab(-1, true);
				}
			},
			//下一個分頁(按住右鍵滾輪向下)
			"W+": {
				name: "\u4E0B\u4E00\u500B\u5206\u9801",
				cmd: function() {
					gBrowser.tabContainer.advanceSelectedTab(1, true);
				}
			},
		},
		init: function () {
			var self = this;
			["mousedown", "mousemove", "mouseup", "contextmenu", "DOMMouseScroll", "dragend"].forEach(function (type) {
				gBrowser.mPanelContainer.addEventListener(type, self, type == "contextmenu");
			});
			window.addEventListener("unload", function () {
				["mousedown", "mousemove", "mouseup", "contextmenu", "DOMMouseScroll", "dragend"].forEach(function (type) {
					gBrowser.mPanelContainer.removeEventListener(type, self, type == "contextmenu");
				});
			}, false);
		},
		handleEvent: function (event) {
				if (event.ctrlKey || event.shiftKey || event.altKey) {return;}//按住ctrl,shift,alt键不起效
			switch (event.type) {
			case "mousedown":
				if (event.button == 2) {
					this.isMouseDownR = true;
					this.hideFireContext = false;
					[this.lastX, this.lastY, this.directionChain] = [event.screenX, event.screenY, ""];
				}
				if (event.button == 2 && this.isMouseDownL) {
					this.isMouseDownR = false;
					this.shouldFireContext = false;
					this.hideFireContext = true;
					this.directionChain = "L>R";
					this.stopGesture(event);
				} else if (event.button == 0) {
					this.isMouseDownL = true;
					if (this.isMouseDownR) {
						this.isMouseDownL = false;
						this.shouldFireContext = false;
						this.hideFireContext = true;
						this.directionChain = "L<R";
						this.stopGesture(event);
					}
				}
				break;
			case "mousemove":
				if (this.isMouseDownR) {
					this.hideFireContext = true;
					var [subX, subY] = [event.screenX - this.lastX, event.screenY - this.lastY];
					var [distX, distY] = [(subX > 0 ? subX : (-subX)), (subY > 0 ? subY : (-subY))];
					var direction;
					if (distX < 10 && distY < 10) return;
					if (distX > distY) direction = subX < 0 ? "L" : "R";
					else direction = subY < 0 ? "U" : "D";
					
					if (direction != this.directionChain.charAt(this.directionChain.length - 1)) {
						this.directionChain += direction;
						XULBrowserWindow.statusTextField.label = this.GESTURES[this.directionChain] ? "\u624b\u52bf: " + this.directionChain + " " + this.GESTURES[this.directionChain].name : "\u672a\u77e5\u624b\u52bf:" + this.directionChain;
					}
					this.lastX = event.screenX;
					this.lastY = event.screenY;
				}
				break;
			case "mouseup":
				if (event.ctrlKey && event.button == 2) {
					this.isMouseDownL = false;
					this.isMouseDownR = false;
					this.shouldFireContext = false;
					this.hideFireContext = false;
					this.directionChain = "";
					event.preventDefault();
					XULBrowserWindow.statusTextField.label = "\u53d6\u6d88\u624b\u52bf";
					break;
				}
				if (this.isMouseDownR && event.button == 2) {
					if (this.directionChain) this.shouldFireContext = false;
					this.isMouseDownR = false;
					this.directionChain && this.stopGesture(event);
				} else if (event.button == 0 && this.isMouseDownL) {
					this.isMouseDownL = false;
					this.shouldFireContext = false;
				}
				break;
			case "contextmenu":
				if (this.isMouseDownL || this.isMouseDownR || this.hideFireContext) {
					var pref = Components.classes["@mozilla.org/preferences-service;1"].getService(Components.interfaces.nsIPrefService);
					var contextmenu = pref.getBoolPref("dom.event.contextmenu.enabled");
					pref.setBoolPref("dom.event.contextmenu.enabled", true);
					setTimeout(function () {
						pref.setBoolPref("dom.event.contextmenu.enabled", contextmenu);
					}, 10);
					event.preventDefault();
					event.stopPropagation();
					this.shouldFireContext = true;
					this.hideFireContext = false;
				}
				break;
			case "DOMMouseScroll":
				if (this.isMouseDownR) {
					event.preventDefault();
					event.stopPropagation();
					this.shouldFireContext = false;
					this.hideFireContext = true;
					this.directionChain = "W" + (event.detail > 0 ? "+" : "-");
					this.stopGesture(event);
				}
				break;
			case "dragend":
				this.isMouseDownL = false;
			}
		},
		stopGesture: function (event) {
			(this.GESTURES[this.directionChain] ? this.GESTURES[this.directionChain].cmd(this, event) & (XULBrowserWindow.statusTextField.label = "") : (XULBrowserWindow.statusTextField.label = "\u672a\u77e5\u624b\u52bf:" + this.directionChain)) & (this.directionChain = "");
		}
	};
	ucjsMouseGestures.init()



})()